import WhatsApp from "./lib/components/ChatExtension";
import Logo from "./lib/components/avatardefault.jpg";
import "./App.css";

function App() {
  const accounts = [
    {
      name: "Example: Sales",
      position: "Example: Sales Support Unit",
      account: "98912*******",
      avatar: <img src={Logo} alt="" />,
      status: true,
      dir:"rtl"
    },
  ];

  return (
    <div>
      <p>Test whatsApp.</p>
      <WhatsApp
      dir="rtl"
        titleDetails={"Responsive, usually respond in minutes."}
        chatOnWhatsApp={"Please chat on WhatsApp"}
        accountList={accounts}
        startChat={"start"}
        question={"سوالی دارید؟"}
        titleChat="Chat via WhatsApp"
      />
    </div>
  );
}

export default App;

